import React, { Component } from 'react';
import kozel from "../../../img/kozel.img";
import "./MainBody.css";
import axios from "axios";

class MainBody extends Component {

    componentDidMount() {
        axios.post('http://localhost:5002/api/origami/list').then(
            (response) => {
                console.log(response);
            }
        ).catch( () => {
            console.log("ssdds")
        })
    }

    render() {
        return (
            <div className="main-body-block">
                <h2>Клуб писи козла</h2>
                <p>В нашем клубе имени знаменитого козла Киркорова вы можете найти не только</p>
                <p>инструкции к прикосновению к его детородному органу.</p>
                <p>Но также подробные указания к тому, как сложить из него нечто прекрасное</p>
                <p>Земля пухом</p>
                <img src = {kozel} />
                <button onClick={this.getOrigamiList}>jskdjh</button>
            </div>
        );
    }
}

export default MainBody;
